import React from 'react'
import html from "../images/html.png";
import javascript from "../images/javaScript.png";
import css from "../images/css.jpg";
import node from "../images/node.png";
import picReact from "../images/react.png";
import { TimelineItem,Timeline,TimelineOppositeContent} from '@material-ui/lab';
import {Typography} from "@material-ui/core";

const Tecnologias =()=>{
    const skills=[
        {
            year:"2010",
            src:html,
            title:"Html",
            starts:5,
        },
        {
            year:"2020",
            src:javascript,
            title:"JavaScript",
            starts:5,
        },
        {
            year:"2020",
            src:css,
            title:"CSS",
            starts:5,
        },
        {
            year:"2020",
            src:node,
            title:"Node.js",
            starts:5,
        },
        {
            year:"2020",
            src:picReact,
            title:"React",
            starts:5,
        }
    ]

    return (
        <Timeline align="left">
            {
                skills.map(({year,src,title,starts},index)=>(
                    <TimelineItem key={index}>
                        <TimelineOppositeContent>
                            <Typography variant="h6" color="textSecondary">
                                {year}
                            </Typography>
                        </TimelineOppositeContent>
                        <TimelineSeparator>
                            <img src={src} alt={title} className={classes.customlogo} />
                        </TimelineSeparator>
                        </TimelineItem>
                ))
            }

        </Timeline>
            
    )
}

export default Tecnologias
